def common(a, b, c, n1, n2, n3):
    a.sort()
    b.sort()
    c.sort()

    LL = []
    
    i, j, k = 0, 0, 0
 
    while(i < n1 and j < n2 and k < n3):

        #print(i,' ', j, ' ', k)
        if(a[i] == b[j] and b[j] == c[k]):
##            print(a[i])
            LL.append(a[i])
            i += 1
            j += 1
            k += 1

        elif a[i] < b[j]:
            i += 1

        elif b[j] < c[k]:
            j += 1

        else:
            k += 1

##    print(LL)
    return sum(LL)


